import pytesseract
from PIL import Image
import base64
import io
pytesseract.pytesseract.tesseract_cmd = r"F:\workstation\python\GitCarDetection\Sudo-CarDetection\myapi\api\CarDetection\asset\lib\tesseract_ocr\tesseract.exe"
def ocr_base64_image(base64_string, lang='eng'):
    # แปลง Base64 เป็นไบต์
    image_data = base64.b64decode(base64_string)
    
    # เปิดรูปภาพด้วย PIL
    image = Image.open(io.BytesIO(image_data))
    
    # ใช้ pytesseract OCR
    text = pytesseract.image_to_string(image, lang=lang)
    
    return text

# ตัวอย่าง Base64 (ใส่ค่า base64 ของรูปภาพจริง)
base64_image = ""

# อ่านข้อความจากภาพ
output_text = ocr_base64_image(base64_image, lang='tha')  # ใช้ภาษาไทย (หรือ 'eng' สำหรับภาษาอังกฤษ)
print(output_text)